import { Col, Container, Row } from "reactstrap";
import "./App.css";
import Documents from "./Documents";
import Projects from "./Projects";
import Tasks from "./Tasks";

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Tasks />
        </Row>
        <Row>
          <Col xs="6">
            <Projects />
          </Col>
          <Col xs="6">
            <Documents />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
